import React from 'react';
import './navbar.css';
import {Link} from 'react-scroll';


const Navbar = () =>{
    return(
        <nav className='navHeader'>
          <h2>Dheeraj Gavini Portfolio</h2>
          <div className='navOptions'>
            <Link className="HeaderMenu">Home</Link>
            <Link className="HeaderMenu">About</Link>
            <Link className="HeaderMenu">Experience</Link>
          </div>
        </nav>
    )
}
export default Navbar;
